(window.webpackJsonp=window.webpackJsonp||[]).push([[9],{231:function(e){e.exports={data:{post:{title:"Working With Languages You Don't Enjoy",path:"/working-with-languages-you-don-t-enjoy",date:"20. June 2019",timeToRead:1,tags:[{id:"languages",title:"languages",path:"/tag/languages"},{id:"lifestyle",title:"lifestyle",path:"/tag/lifestyle"}],description:"Markdown is intended to be as easy-to-read and easy-to-write as is feasible. Readability, however, is emphasized above all else. A Markdown-formatted document should be publishable as-is, as plain text, without looking like it's been marked up with tags or formatting instructions.",content:"<p>Sometimes we, as professional developers, have to work with languages and and technologies that we don't love\n(I'm looking at you, PHP). We've all been that at some point or another in our careers and if you can honestly\nsay that you've never been in this position then please hire me and I'll take down this article. Anyways, I've\nbeen in this scenario at some point with every job I've had and it took me years to become content with it and\nmaybe I can help someone else in this same situation. Now of course this advice won't apply to every single language\nknown to mankind (I have to say that for CSS fanatics) but it could work for you.</p>\n<h2 id=\"meet-the-contenders\"><a href=\"#meet-the-contenders\" aria-hidden=\"true\"><span class=\"icon icon-link\"></span></a>Meet The Contenders</h2>\n<p>So in order to make this more personal I'll use an expereince of mine for this case study. Now if you've read even\na morsel of anything else I've written you'll know I'm a lover of JavaScript. If you're laughing I'd appreciate you\nholding off on reading the rest of the article until you're done. So in one corner we have JavaScript and in the other\ncorder we have...PHP. Now I'm not saying that PHP is a terrible language, it is just my opinion and it is my archnemesis\nand nothing can change that. PHP was the first server-side language I ever picked up and I didn't like it from the beginning\nbut it does power a lot of the web and is almost unavaoidable at some point in a web developer's career.</p>\n<h2 id=\"different-languages-similar-structure\"><a href=\"#different-languages-similar-structure\" aria-hidden=\"true\"><span class=\"icon icon-link\"></span></a>Different Languages, Similar Structure</h2>\n",coverImage:{type:"image",mimeType:"image/jpeg",src:"/assets/static/alexandr-podvalny-220262-unsplash.07cc2b7.4903438.jpg",size:{width:860,height:573},sizes:"(max-width: 860px) 100vw, 860px",srcset:["/assets/static/alexandr-podvalny-220262-unsplash.a67b0b2.4903438.jpg 480w","/assets/static/alexandr-podvalny-220262-unsplash.07cc2b7.4903438.jpg 860w"],dataUri:"data:image/svg+xml,%3csvg fill='none' viewBox='0 0 860 573' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink'%3e%3cdefs%3e%3cfilter id='__svg-blur-13'%3e%3cfeGaussianBlur in='SourceGraphic' stdDeviation='10'/%3e%3c/filter%3e%3c/defs%3e%3cimage x='0' y='0' filter='url(%23__svg-blur-13)' width='860' height='573' xlink:href='data:image/jpeg%3bbase64%%2bmMkpzYXHorWOjLjyW/T4YXW0KqaRItSgbTOPRTNpHHoV1lNgrnW4T2VpTZdc63D4W8PNhxm/RHCNoXH8pUzMPeehRKp8qvcBZnhWVPk57v0/CZSh1ElTqdAYUuHuBHCVZQ0LjbQonQZLfp90ey2m5SMYuYz2XaNenHmTTo1HyBPEZIBeWnpx6XlsrWnnqmxtdHh0JvyO2dVxMON1EJvC4Md%2b5rRfusnxqsmFqipneD0dIforXC3%2bJGp3i9wQY8VxGIgihpAPc/6p34/i7C1zm01O1pvpZo%2bd0Oo8bkihMdM1sV/wAT%2bb3fM8h7BNmxmqqGbNRO6VtrWfZ31RwtlvgK6l89nUCzhOe8Qjm3b2YTVG%2bjNrZd4K6Nudsba3gwKiab8yXnTuvPrqtr28YGnL1U9Pibo5WubUVMY5bTH6/UJHRtm9XBfozq3qWiqPsmGzMGdMxV9KKemp4MNF7vfATtu9rk6D4KpGb83U%2byXVW9jAsRJC11x8bf2ht9oamO26xOsH89beVDUZsxLVorpJPe2nldMLWMccFp3J/PSnlxN/tHKia3UpTKSbk%2bVrhLfVQZM9rBE4kI6jus3x9QoeqcOi2rNih5ld6rN4fUppAHJKOQW3BohdspCT1KaSVGSUGwqJ//2Q==' /%3e%3c/svg%3e"}}}}}}]);